INSERT INTO `broadcasts` (`id`, `id_user`, `id_kegiatan`, `judul_broadcast`, `isi_broadcast`, `date_create`, `date_deleted`) VALUES
(1, 1, 1, 'Pengumuman Update Fasih Engine', 'Assalamualaikum bapak/ibu semua, utk pekerjaan manen sawit menggunakan alat manual, itu statusnya tetap pekerja ya bapak ibu. jika majikannya tetap tp lebih dr 1, maka pekerjaa utama adalah di 1 majikan yang paling banyak jam kerja biasanya dalam seminggu, dilanjutkan tambahan utama majikan terbanyak selanjutnya.', '2025-11-13 20:41:37', NULL),
(2, 1, 1, 'Pengumuman Perbaikan Anomali', 'Assalamualaikum bapak/ibu semua, utk pekerjaan manen sawit menggunakan alat manual, itu statusnya tetap pekerja ya bapak ibu. jika majikannya tetap tp lebih dr 1, maka pekerjaa utama adalah di 1 majikan yang paling banyak jam kerja biasanya dalam seminggu, dilanjutkan tambahan utama majikan terbanyak selanjutnya.', '2025-11-13 20:41:37', NULL);
