INSERT INTO `kategori_anomali` (`id`, `id_kegiatan`, `kode_anomali`, `definisi_anomali`, `detil_anomali`, `is_show`, `date_created`, `date_deleted`) VALUES
(1, 1, 'AN01', 'Cek konsistensi jenis kelamin Kepala Keluarga.', 'Jenis kelamin KK tidak sesuai dengan aturan sensus.', 1, '2025-11-05 13:04:39', NULL),
(2, 1, 'AN02', 'Verifikasi usia responden yang berusia di bawah 5 tahun.', 'Usia di bawah 5 tahun memiliki data pendidikan formal yang terisi.', 1, '2025-11-05 13:04:45', NULL),
(3, 1, 'AN03', 'Cek data pekerjaan untuk responden berusia di atas 70 tahun.', 'Responden lansia (>70) terdeteksi memiliki pekerjaan full-time.', 1, '2025-11-05 13:05:10', NULL),
(4, 1, 'AN04', 'Pemeriksaan status perkawinan responden di bawah 15 tahun.', 'Responden di bawah usia legal perkawinan terdeteksi menikah.', 0, '2025-11-05 13:05:30', NULL),
(5, 1, 'AN05', 'Cek kelengkapan data alamat dan kode pos.', 'Kolom kode pos kosong atau tidak valid.', 1, '2025-11-05 13:06:01', NULL),
(6, 1, 'AN06', 'Konsistensi hubungan dengan Kepala Keluarga (Hubungan Ganda).', 'Ditemukan lebih dari satu responden berstatus \"Istri\" dalam satu KK.', 1, '2025-11-05 13:06:22', NULL),
(7, 1, 'AN07', 'Verifikasi status disabilitas dan kemampuan bekerja.', 'Responden disabilitas berat terdeteksi bekerja di sektor formal.', 1, '2025-11-05 13:07:05', NULL),
(8, 1, 'AN08', 'Cek kesesuaian tingkat pendidikan dengan jenis pekerjaan.', 'Pendidikan SD memiliki pekerjaan sebagai Manajer/Profesional.', 0, '2025-11-05 13:07:40', NULL),
(9, 1, 'AN09', 'Pemeriksaan data migrasi (tempat lahir dan tempat tinggal saat ini).', 'Tempat lahir berada di luar negeri, tetapi tidak ada catatan migrasi.', 1, '2025-11-05 13:08:00', NULL),
(10, 1, 'AN10', 'Cek keberadaan NIK yang duplikat dalam wilayah sensus.', 'Nomor Induk Kependudukan (NIK) terdeteksi ganda.', 1, '2025-11-05 13:08:35', NULL),
(11, 1, 'AN11', 'Validasi tanggal lahir (usia lebih dari 100 tahun).', 'Responden berusia sangat lanjut (>100) memerlukan verifikasi data.', 1, '2025-11-05 13:09:12', NULL),
(12, 1, 'AN12', 'Pemeriksaan data kepemilikan aset (aset dan pendapatan tidak konsisten).', 'Pendapatan sangat rendah, namun memiliki aset properti mewah.', 0, '2025-11-05 13:09:40', NULL),
(13, 1, 'AN13', 'Cek konsistensi data kepemilikan lahan pertanian.', 'Lahan pertanian yang dicatat melebihi batas kepemilikan maksimum.', 1, '2025-11-05 13:10:05', NULL),
(14, 1, 'AN14', 'Verifikasi nomor telepon (terdapat format yang tidak baku).', 'Format nomor kontak responden tidak mengikuti standar nasional.', 1, '2025-11-05 13:10:30', NULL),
(15, 1, 'AN15', 'Cek kelengkapan kolom penghasilan per bulan (terdapat nilai 0).', 'Kolom penghasilan wajib terisi, namun bernilai nol (0).', 0, '2025-11-05 13:11:00', NULL),
(16, 1, 'AN16', 'Konsistensi status kepemilikan rumah (kontrak/milik sendiri).', 'Ditemukan status kepemilikan ganda atau tidak jelas.', 1, '2025-11-05 13:11:34', NULL),
(17, 1, 'AN17', 'Pemeriksaan kode wilayah (kecamatan dan desa tidak sesuai).', 'Kombinasi kode kecamatan dan desa tidak terdaftar.', 1, '2025-11-05 13:12:01', NULL),
(18, 1, 'AN18', 'Validasi data penggunaan air minum dan sanitasi.', 'Air minum dari PDAM, namun tidak memiliki fasilitas sanitasi yang layak.', 1, '2025-11-05 13:12:30', NULL),
(19, 1, 'AN19', 'Cek kelengkapan data vaksinasi pada anak-anak.', 'Anak usia sekolah tidak memiliki catatan vaksinasi dasar lengkap.', 0, '2025-11-05 13:13:00', NULL),
(20, 1, 'AN20', 'Pemeriksaan status kepemilikan hewan ternak (jumlah melebihi batas wajar).', 'Ditemukan jumlah ternak yang tidak realistis untuk ukuran rumah tangga biasa.', 1, '2025-11-05 13:13:30', NULL);
